	The CustomValidation section defines custom validation to be performed on specific
	keyword types.  Custom validation can be defined to occur across the entire application
	and for individual pages.  If a keyword type is defined at both the application and page
	level, the page level definition will take precedence on that page only.  Page and script
	file locations are all relative to the virtual root and are case-insensitive.  However,
	validator names are case-sensitive.
