  </configProtectedData>
  <system.web>
    <compilation defaultLanguage=""c#"" debug=""false"" targetFramework=""4.8"">
      <!-- Begin ASP.Net AJAX compilation settings -->
      <buildProviders>
        <add extension=""*.asbx"" type=""Microsoft.Web.Preview.Services.BridgeBuildProvider"" />
