  <!--
	The CustomValidation section defines custom validation to be performed on specific
	keyword types.  Custom validation can be defined to occur across the entire application
	and for individual pages.  If a keyword type is defined at both the application and page
	level, the page level definition will take precedence on that page only.  Page and script
	file locations are all relative to the virtual root and are case-insensitive.  However,
	validator names are case-sensitive.
	-->
  <CustomValidation>
    <!--
		Keywords defined in the application section will have custom validation run on them whenever they
		appear in editable form.  These settings can be overridden on a page-by-page basis.
		Example usage:

		<application scriptLocation=""/Scripts/SampleJavaScriptFile.js"">
			<keywords>
				<keyword id=""123"" validator=""SampleValidationFunction"" />
				<keyword id=""124"" validator=""SampleValidationFunction2"" />
			</keywords>
		</application>
		-->
    <application scriptLocation="""">
      <keywords></keywords>
    </application>
    <!--
		The following section is used to define custom validation on an .aspx page-by-page basis.
		Example usage:

		<page location=""/CustomQuery.aspx"" scriptLocation=""SampleJavaScriptFile.js"">
			<keywords>
				<keyword id=""123"" validator=""SampleValidationFunction2"" />
				<keyword id=""125"" validator=""SampleValidationFunction3"" />
			</keywords>
		</page>
		-->
